import { Route} from "react-router-dom";
import Landing from "./views/Landing/Landing";
import Home from "./views/Home/Home";
import Form from "./views/Form/Form";
import Detail from "./views/Detail/Detail";

function App() {
  return (
    <div className="App">

      <Route exact path="/">
        <Landing />
      </Route>

      <Route path="/home">
        <Home />
      </Route>

      <Route path="/form">
        <Form />
      </Route>

      <Route path="/detail">
        <Detail />
      </Route>
    </div>
  );
}

export default App;
